Var.NCText.Header7=get(handles.edit7,'String');
Var.NCText.Header8=get(handles.edit8,'String');
Var.NCText.Header9=get(handles.edit9,'String');
Var.NCText.Header10=get(handles.edit10,'String');
Var.NCText.Header11=get(handles.edit11,'String');
Var.NCText.Header12=get(handles.edit12,'String');
Var.NCText.Laseron=get(handles.edit13,'String');
Var.NCText.Laseroff=get(handles.edit14,'String');
Var.NCText.Kommentar1=get(handles.edit15,'String');
Var.NCText.Kommentar2=get(handles.edit16,'String');
Var.NCText.X=get(handles.edit17,'String');
Var.NCText.Y=get(handles.edit18,'String');
Var.NCText.Z=get(handles.edit19,'String');
Var.NCText.B=get(handles.edit20,'String');
Var.NCText.C=get(handles.edit21,'String');
Var.NCText.u=get(handles.edit22,'String');
Var.NCText.v=get(handles.edit23,'String');
Var.NCText.BahnPunktSta=get(handles.edit24,'String');
Var.NCText.BahnPunktEnd=get(handles.edit25,'String');
Var.NCText.Finish1=get(handles.edit30,'String');
Var.NCText.Finish2=get(handles.edit31,'String');
Var.NCText.Finish3=get(handles.edit32,'String');
Var.NCText.Finish4=get(handles.edit33,'String');
Var.NCText.Finish5=get(handles.edit34,'String');

Var.NCText.Vorschub1=get(handles.edit26,'String');
Var.NCText.Vorschub2=get(handles.edit27,'String');
Var.NCText.LaserSta=get(handles.edit28,'String');
Var.NCText.LaserEnd=get(handles.edit29,'String');

Var.NCText.MoveabsX=get(handles.edit35,'String');
Var.NCText.MoveabsY=get(handles.edit36,'String');
Var.NCText.MoveabsZ=get(handles.edit37,'String');
Var.NCText.MoveabsB=get(handles.edit38,'String');
Var.NCText.MoveabsC=get(handles.edit39,'String');
Var.NCText.Movewait=get(handles.edit40,'String');
Var.NCText.Hatchscan1=get(handles.edit41,'String');
Var.NCText.Hatchscan2=get(handles.edit42,'String');
Var.NCText.Hatchscan3=get(handles.edit43,'String');
Var.NCText.Hatchjump1=get(handles.edit44,'String');
Var.NCText.Hatchjump2=get(handles.edit45,'String');
Var.NCText.Hatchjump3=get(handles.edit46,'String');

LaserOnOffalle=get(handles.checkbox1,'Value');
NCCodeKomplett=get(handles.checkbox2,'Value');
Hatches=Var.Hatches;
BahnPunkte=Var.BahnPunkte;
Umfangsabtrag=Var.Umfangsabtrag;
Zickzack=Var.Zickzack;
Zusammenfassen=Var.Zusammenfassen;
Scangeschw=Var.Scangeschw;
Jumpgeschw=Var.Jumpgeschw;
VorschubCmax=Var.VorschubCmax;
NCText=Var.NCText;
Titelpfad=[Var.FolderName,'\',Var.Titel,'.txt'];

%Funktionen die den NC-Code berechnen und erstellen
[Hatches2,BahnPunkte2,Vorschub]=F53_NCCodeBerechnung(Hatches,BahnPunkte,...
    Umfangsabtrag,Zickzack,Zusammenfassen,Scangeschw,Jumpgeschw,VorschubCmax);
if NCCodeKomplett==1
    %NC-Code erstellen, Methode ausschreiben
    F54_NCCodeSynchron(Hatches2,BahnPunkte2,Titelpfad,NCText,Vorschub,Umfangsabtrag,LaserOnOffalle);
else %NCCodeKomplett==0
    %NC-Code erstellen, Methode Bahnachsen losschicken
    F55_NCCodeMOVEABS(Hatches2,BahnPunkte2,Titelpfad,NCText,Vorschub,Umfangsabtrag,LaserOnOffalle);
end
disp('NC-Code erstellt');
close(NCCodetangential)


